Use POO_projet;

DROP TABLE IF EXISTS Contient;
DROP TABLE IF EXISTS Produit;
DROP TABLE IF EXISTS Personnel;
DROP TABLE IF EXISTS Paiements;
DROP TABLE IF EXISTS Commande;
DROP TABLE IF EXISTS Client_;
DROP TABLE IF EXISTS Adresse;
DROP TABLE IF EXISTS Villes;
GO

CREATE TABLE Villes(
	id_ville INT IDENTITY(1, 1),
	nom_ville VARCHAR(50),
    code_postal INT,
    nom_region VARCHAR(50),
	PRIMARY KEY(id_ville)
);

CREATE TABLE Adresse(
   id_adresse INT IDENTITY(1, 1),
   numero SMALLINT,
   id_ville INT,
   rue VARCHAR(60),
   PRIMARY KEY(id_adresse),
   FOREIGN KEY(id_ville) REFERENCES Villes(id_ville),
);

CREATE TABLE Client_(
   id_client INT IDENTITY(1, 1),
   nom_client VARCHAR(40),
   prenom_client VARCHAR(40),
   date_naissance DATE,
   date_1er_achat DATE,
   logo_entreprise VARCHAR(200),
   nom_entreprise VARCHAR(60),
   id_adresse_livraison INT NOT NULL,
   id_adresse_facturation INT NOT NULL,
   PRIMARY KEY(id_client),
   FOREIGN KEY(id_adresse_livraison) REFERENCES Adresse(id_adresse),
   FOREIGN KEY(id_adresse_facturation) REFERENCES Adresse(id_adresse)
);

CREATE TABLE Commande(
   id_commande INT IDENTITY(1, 1),
   ref_commande VARCHAR(30),
   date_livraison DATE,
   date_expedition DATE,
   moyen_paiement VARCHAR(50),
   nb_articles INT,
   remise SMALLINT,
   total_tva DECIMAL(15,2),
   total_ht DECIMAL(15,2),
   total_ttc DECIMAL(15,2),
   id_client INT,
   PRIMARY KEY(id_commande),
   FOREIGN KEY(id_client) REFERENCES Client_(id_client)
);

CREATE TABLE Paiements(
   id_paiement INT IDENTITY(1, 1),
   solde_reste_a_payer DECIMAL(15,2),
   date_paiement DATE,
   montant_paiement DECIMAL(15,2),
   id_commande INT NOT NULL,
   PRIMARY KEY(id_paiement),
   FOREIGN KEY(id_commande) REFERENCES Commande(id_commande)
);

CREATE TABLE Personnel(
   id_personnel INT IDENTITY(1, 1),
   nom_personnel VARCHAR(40),
   prenom_personnel VARCHAR(40),
   date_embauche DATE,
   id_supperieur INT,
   id_adresse INT NOT NULL,
   PRIMARY KEY(id_personnel),
   FOREIGN KEY(id_supperieur) REFERENCES Personnel(id_personnel),
   FOREIGN KEY(id_adresse) REFERENCES Adresse(id_adresse)
);

CREATE TABLE Produit(
   id_produit INT IDENTITY(1, 1),
   prix_achat DECIMAL(15,2),
   prix_commerce DECIMAL(15,2),
   prix_degressif BIT,
   nom_produit VARCHAR(50),
   quantite_dispo INT,
   quantite_reapro INT,
   taux_tva SMALLINT,
   type_ VARCHAR(50),
   couleur VARCHAR(50),
   PRIMARY KEY(id_produit),
);

CREATE TABLE Contient(
   id_commande INT,
   id_produit INT,
   qt_produit INT,
   PRIMARY KEY(id_commande, id_produit),
   FOREIGN KEY(id_commande) REFERENCES Commande(id_commande),
   FOREIGN KEY(id_produit) REFERENCES Produit(id_produit)
);
GO

