CREATE PROCEDURE ExisteVille
	@nom_ville VARCHAR(50),
	@code_postal INT
AS
	IF EXISTS (SELECT * FROM Villes WHERE nom_ville = @nom_ville AND code_postal = @code_postal)
		BEGIN
			RETURN 1
		END
	ELSE
		BEGIN
			RETURN 0
		END
GO

CREATE PROCEDURE CreerAdresse
    @rue VARCHAR(60),
	@nom_ville VARCHAR(60),
	@numero SMALLINT,
    @code_postal INT
AS
	DECLARE @id_ville INT;
	SET @id_ville = (SELECT id_ville FROM Villes WHERE @nom_ville = nom_ville AND @code_postal = code_postal);
GO

CREATE PROCEDURE CreerPersonnel
	@nom_personnel VARCHAR(40),
	@prenom_personnel VARCHAR(40),
	@id_supperieur INT,
	@date_embauche DATE,
	@ville_personnel VARCHAR(60),
	@rue_personnel VARCHAR(60),
    @numero_personnel SMALLINT,
    @code_postal_personnel INT
AS
	DECLARE @existe BIT;
	EXEC @existe = ExisteVille @nom_ville = @ville_personnel, @code_postal = @code_postal_personnel;
	IF @existe = 0
		BEGIN
			PRINT 'Erreur, la ville séléctionner n' + char(39) + 'existe pas'
			RETURN
		END
	ELSE
		BEGIN
			DECLARE @id_adresse INT;
			IF EXISTS (SELECT A.id_adresse FROM Adresse A JOIN Villes V ON A.id_ville = V.id_ville WHERE @rue_personnel = A.rue AND @numero_personnel = A.numero AND @code_postal_personnel = V.code_postal AND @ville_personnel = V.nom_ville)
				BEGIN
					Set @id_adresse = @id_adresse
				END
			ELSE
				BEGIN
					EXEC CreerAdresse @rue = @rue_personnel, @nom_ville = @ville_personnel, @numero = @numero_personnel, @code_postal= @code_postal_personnel
				END
			SELECT @id_adresse=A.id_adresse FROM Adresse A JOIN Villes V ON A.id_ville = V.id_ville WHERE @rue_personnel = A.rue AND @numero_personnel = A.numero AND @code_postal_personnel = V.code_postal AND @ville_personnel = V.nom_ville
		END
GO

CREATE PROCEDURE SupprimerPersonnel
	@id_personnel INT
AS
	UPDATE Personnel 
	SET id_supperieur = NULL
	WHERE id_supperieur = @id_personnel
	DELETE FROM Personnel WHERE id_personnel = @id_personnel;
GO

