		END
	ELSE
		BEGIN
			DECLARE @id_adresse INT;
			IF EXISTS (SELECT A.id_adresse FROM Adresse A JOIN Villes V ON A.id_ville = V.id_ville WHERE @rue_personnel = A.rue AND @numero_personnel = A.numero AND @code_postal_personnel = V.code_postal AND @ville_personnel = V.nom_ville)
				BEGIN
					Set @id_adresse = @id_adresse
				END
			ELSE
				BEGIN
					EXEC CreerAdresse @rue = @rue_personnel, @nom_ville = @ville_personnel, @numero = @numero_personnel, @code_postal= @code_postal_personnel
				END
			SELECT @id_adresse=A.id_adresse FROM Adresse A JOIN Villes V ON A.id_ville = V.id_ville WHERE @rue_personnel = A.rue AND @numero_personnel = A.numero AND @code_postal_personnel = V.code_postal AND @ville_personnel = V.nom_ville
