CREATE PROCEDURE AfficherPersonnel
AS
    SELECT P.[id_personnel] AS 'ID', P.[nom_personnel] AS 'Nom', P.[prenom_personnel] AS 'Prenom', P.[date_embauche] AS 'Date embauche',
	P.[id_supperieur] AS 'Supperieur', V.[nom_ville] AS 'Ville', A.[rue] AS 'Rue', A.[numero] AS 'Numero', V.[code_postal] AS 'Code postal', V.[nom_region] AS 'Region'
	FROM ([POO_Projet].[dbo].[Personnel] P JOIN [POO_Projet].[dbo].[Adresse] A ON A.id_adresse = P.id_adresse) JOIN [POO_Projet].[dbo].[Villes] V ON A.id_ville = V.id_ville;
GO

CREATE PROCEDURE CreerClient
	@nom_client VARCHAR(40),
	@prenom_client VARCHAR(40),
	@date_naissance DATE,
	@date_1er_achat DATE,
	@logo_entreprise VARCHAR(200),
	@nom_entreprise VARCHAR(60),
	@ville_livraison VARCHAR(60),
	@rue_livraison VARCHAR(60),
    @numero_livraison SMALLINT,
    @code_postal_livraison INT,
	@ville_facturation VARCHAR(60),
	@rue_facturation VARCHAR(60),
    @numero_facturation SMALLINT,
    @code_postal_facturation INT
AS
	DECLARE @existe BIT;
	EXEC @existe = ExisteVille @nom_ville = @ville_livraison, @code_postal = @code_postal_livraison;
	IF @existe = 0
		BEGIN
			PRINT 'Erreur, la ville séléctionner n' + char(39) + 'existe pas'
			RETURN
		END
	ELSE
		BEGIN
			DECLARE @id_adresse_livraison INT;
			IF EXISTS (SELECT A.id_adresse FROM Adresse A JOIN Villes V ON A.id_ville = V.id_ville WHERE @rue_livraison = A.rue AND @numero_livraison = A.numero AND @code_postal_livraison = V.code_postal AND @ville_livraison = V.nom_ville)
				Set @id_adresse_livraison = @id_adresse_livraison
			ELSE
				EXEC CreerAdresse @rue = @rue_livraison, @nom_ville = @ville_livraison, @numero = @numero_livraison, @code_postal= @code_postal_livraison
			SELECT @id_adresse_livraison=id_adresse FROM Adresse A JOIN Villes V ON A.id_ville = V.id_ville WHERE @rue_livraison = A.rue AND @numero_livraison = A.numero AND @code_postal_livraison = V.code_postal AND @ville_livraison = V.nom_ville
		END
	EXEC @existe = ExisteVille @nom_ville = @ville_facturation, @code_postal = @code_postal_facturation;
	IF @existe = 0
		BEGIN
			PRINT 'Erreur, la ville séléctionner n' + char(39) + 'existe pas'
			RETURN
		END
	ELSE
		BEGIN
			DECLARE @id_adresse_facturation INT;
			IF EXISTS (SELECT A.id_adresse FROM Adresse A JOIN Villes V ON A.id_ville = V.id_ville WHERE @rue_facturation = A.rue AND @numero_facturation = A.numero AND @code_postal_facturation = V.code_postal AND @ville_facturation = V.nom_ville)
				Set @id_adresse_facturation = @id_adresse_facturation
			ELSE
				EXEC CreerAdresse @rue = @rue_facturation, @nom_ville = @ville_facturation, @numero = @numero_facturation, @code_postal= @code_postal_facturation
			SELECT @id_adresse_facturation=id_adresse FROM Adresse A JOIN Villes V ON A.id_ville = V.id_ville WHERE @rue_livraison = A.rue AND @numero_livraison = A.numero AND @code_postal_livraison = V.code_postal AND @ville_facturation = V.nom_ville
		END
GO

CREATE PROCEDURE SupprimerClient
	@id_client INT
AS
	UPDATE Commande
	SET id_client = NULL
	WHERE id_commande = (SELECT id_commande FROM (Commande INNER JOIN Client_ ON (Commande.id_client = Client_.id_client)) WHERE Client_.id_client = @id_client);
	DELETE FROM Client_ WHERE id_client = @id_client;
GO

