		END
GO

CREATE PROCEDURE AfficherClient
AS
    SELECT C.id_client as 'ID', C.nom_client AS 'Nom', C.prenom_client AS 'Prenom', C.date_naissance AS 'Date de naissance',
	C.date_1er_achat AS 'Date 1er achat', C.logo_entreprise AS 'Lien logo', C.nom_entreprise AS 'Nom entreprise', VL.nom_region AS 'Region livraison', VL.nom_ville AS 'Ville livraison',
	AL.rue AS 'Rue livraison', AL.numero AS 'Numero livraison', VL.code_postal AS 'Code postal livraison', VF.nom_region AS 'Region facturation', VF.nom_ville AS 'Ville facturation',
	AF.rue AS 'Rue facturation', AF.numero AS 'Numero facturation', VF.code_postal AS 'Code postal facturation'
	FROM [POO_Projet].[dbo].[Client_] C JOIN [POO_Projet].[dbo].[Adresse] AL
	ON AL.id_adresse = C.id_adresse_livraison JOIN [POO_Projet].[dbo].[Adresse] AF ON AF.id_adresse = C.id_adresse_facturation 
	JOIN [POO_Projet].[dbo].[Villes] VL ON AL.id_ville = VL.id_ville JOIN [POO_Projet].[dbo].[Villes] VF ON AF.id_ville = VF.id_ville;
GO

