AS
GO

CREATE PROCEDURE CreerContientProduit
	@id_produit INT,
	@qt_produit INT
AS
	DECLARE @id_commande INT;
	SET @id_commande = (SELECT MAX(id_commande) FROM Commande);
	UPDATE Produit
	SET quantite_dispo = quantite_dispo - @qt_produit
	WHERE id_produit = @id_produit
GO

CREATE PROCEDURE CreerPrix
AS
	DECLARE @id_commande INT;
	DECLARE @ref_commande VARCHAR(30);
	DECLARE @nb_articles INT;
	DECLARE @total_tva DECIMAL(15,2);
	DECLARE @total_ht DECIMAL(15,2);
	DECLARE @total_ttc DECIMAL(15,2);
	SET @id_commande = (SELECT MAX(id_commande) FROM Commande);
	SET @ref_commande = (SELECT CONCAT(LEFT(Client_.nom_client,2), LEFT(Client_.prenom_client,2), YEAR(date_livraison), LEFT(Villes.nom_ville,3), id_commande) FROM Commande Join Client_ ON Client_.id_client = Commande.id_client JOIN Adresse ON Adresse.id_adresse = Client_.id_adresse_livraison JOIN Villes ON Adresse.id_ville = Villes.id_ville WHERE id_commande = @id_commande);
	SET @nb_articles = (SELECT SUM(qt_produit) FROM Contient WHERE @id_commande = id_commande);
	SET @total_tva = (SELECT SUM((Produit.prix_commerce*Produit.taux_tva)/100) FROM Contient INNER JOIN Produit ON Contient.id_produit = Produit.id_produit WHERE Contient.id_commande = @id_commande);
	SET @total_ht = (SELECT SUM(Produit.prix_commerce) FROM Contient INNER JOIN Produit ON Contient.id_produit = Produit.id_produit WHERE Contient.id_commande = @id_commande);
	SET @total_ttc = @total_tva+@total_ht;
	UPDATE Commande 
	SET ref_commande = @ref_commande,
		total_tva = @total_tva,
		total_ht = @total_ht,
		total_ttc = @total_ttc,
		nb_articles = @nb_articles
	WHERE id_commande = @id_commande
GO

CREATE PROCEDURE SupprimerCommande
	@id_commande INT
AS
	DELETE FROM Contient WHERE id_commande = @id_commande;
	DELETE FROM Paiements WHERE id_commande = @id_commande;
	DELETE FROM Commande WHERE id_commande = @id_commande;
GO

CREATE PROCEDURE ModifierCommande
	@id_commande INT,
	@date_livraison DATE,
	@date_expedition DATE,
	@moyen_paiement VARCHAR(50),
	@remise INT,
    @id_client INT
AS
	UPDATE Commande 
	SET date_livraison = @date_livraison,
		date_expedition = @date_expedition,
		moyen_paiement = @moyen_paiement,
		remise = @remise,
		id_client = @id_client
	WHERE id_commande = @id_commande
	DELETE FROM Contient WHERE id_commande = @id_commande
GO

CREATE PROCEDURE ModifierContientProduit
	@id_commande INT,
	@id_produit INT,
	@qt_produit INT
AS
	UPDATE Produit
	SET quantite_dispo = quantite_dispo - @qt_produit
	WHERE id_produit = @id_produit
GO

CREATE PROCEDURE ModifierPrix
	@id_commande INT
AS
	DECLARE @nb_articles INT;
	DECLARE @ref_commande VARCHAR(30);
	DECLARE @total_tva DECIMAL(15,2);
	DECLARE @total_ht DECIMAL(15,2);
	DECLARE @total_ttc DECIMAL(15,2);
	SET @ref_commande = (SELECT CONCAT(LEFT(Client_.nom_client,2), LEFT(Client_.prenom_client,2), YEAR(date_livraison), LEFT(Villes.nom_ville,3), id_commande) FROM Commande Join Client_ ON Client_.id_client = Commande.id_client JOIN Adresse ON Adresse.id_adresse = Client_.id_adresse_livraison JOIN Villes ON Adresse.id_ville = Villes.id_ville WHERE id_commande = @id_commande);
	SET @nb_articles = (SELECT SUM(qt_produit) FROM Contient WHERE @id_commande = id_commande);
	SET @total_tva = (SELECT SUM((Produit.prix_commerce*Produit.taux_tva)/100) FROM Contient INNER JOIN Produit ON Contient.id_produit = Produit.id_produit WHERE Contient.id_commande = @id_commande);
	SET @total_ht = (SELECT SUM(Produit.prix_commerce) FROM Contient INNER JOIN Produit ON Contient.id_produit = Produit.id_produit WHERE Contient.id_commande = @id_commande);
	SET @total_ttc = @total_tva+@total_ht;
	UPDATE Commande 
	SET ref_commande = @ref_commande,
		total_tva = @total_tva,
		total_ht = @total_ht,
		total_ttc = @total_ttc,
		nb_articles = @nb_articles
	WHERE id_commande = @id_commande
GO

CREATE PROCEDURE AfficherCommande
AS
	SELECT id_commande AS 'ID', ref_commande AS 'Reference commande', date_livraison AS 'Date de livraison', date_expedition AS 'Date expedition',
	moyen_paiement AS 'Moyen de paiement', nb_articles AS 'Nombre articles', remise AS 'Remise', total_ht AS 'Total hors taxes',
