		type_ = @type_,
		couleur = @couleur
	WHERE id_produit = @id_produit
GO

CREATE PROCEDURE AfficherProduit
AS
	SELECT id_produit AS 'ID', prix_achat AS 'Prix achat', prix_commerce AS 'Prix commerce', prix_degressif AS 'Prix degressif',
	nom_produit AS 'Nom produit', quantite_dispo AS 'Quantite disponible', quantite_reapro AS 'Seuil de reaprovisionnement', taux_tva AS 'Taux taxe valeur ajoutée',
	type_ AS 'Type', couleur AS 'Couleur' FROM Produit;
GO

CREATE PROCEDURE PanierMoyen
AS
	SELECT AVG(total_ttc - (total_ttc*remise)/100) AS 'Panier moyen'
	FROM Commande;
GO

CREATE PROCEDURE ChiffreAffaire
	@mois DATE
AS
	SELECT SUM(total_ttc - (total_ttc*remise)/100) AS'Chiffre affaires'
	FROM Commande
	WHERE MONTH(date_livraison) = MONTH(@mois) AND YEAR(date_livraison) = YEAR(@mois);
GO

CREATE PROCEDURE SousReapro
AS
	SELECT id_produit AS 'ID', nom_produit AS 'Nom produit', type_ AS 'Type', quantite_dispo AS 'Quantite disponible', quantite_reapro AS 'Seuil de reaprovisionnement'
	FROM Produit
	WHERE quantite_dispo < quantite_reapro;
GO

CREATE PROCEDURE TotalAchat
	@id_client int
AS
	SELECT SUM(total_ttc - (total_ttc*remise)/100) AS 'Total achat du client'
	FROM Commande
	WHERE id_client = @id_client
GO

CREATE PROCEDURE Top10
AS
	SELECT TOP(10) COUNT(Contient.id_produit) AS 'Total acheté', nom_produit AS 'Nom produit', type_ AS 'Type', couleur AS 'Couleur', prix_achat AS 'Prix achat', prix_commerce AS 'Prix commerce', quantite_dispo AS 'Quantite disponible', quantite_reapro AS 'Seuil de reaprovisionnement'
	FROM Contient INNER JOIN Produit ON (Contient.id_produit = Produit.id_produit)
	GROUP BY Contient.id_produit, nom_produit, type_, couleur, prix_achat, prix_commerce, quantite_dispo, quantite_reapro
	ORDER BY 'Total acheté' DESC
GO

CREATE PROCEDURE Bottom10
AS
	SELECT TOP(10) COUNT(Contient.id_produit) AS 'Total acheté', nom_produit AS 'Nom produit', type_ AS 'Type', couleur AS 'Couleur', prix_achat AS 'Prix achat', prix_commerce AS 'Prix commerce', quantite_dispo AS 'Quantite disponible', quantite_reapro AS 'Seuil de reaprovisionnement'
	FROM Contient INNER JOIN Produit ON (Contient.id_produit = Produit.id_produit)
	GROUP BY Contient.id_produit, nom_produit, type_, couleur, prix_achat, prix_commerce, quantite_dispo, quantite_reapro
	ORDER BY 'Total acheté'  ASC
GO

CREATE PROCEDURE ValeurCommercialStock
AS
	SELECT SUM(prix_commerce * quantite_dispo) AS 'Valeur commercial du stock'
	FROM Produit
GO

CREATE PROCEDURE ValeurAchatStock
AS
	SELECT SUM(prix_achat * quantite_dispo) AS 'Valeur achat du stock'
	FROM Produit
GO